import React from 'react';
import './Rect.css';

function Rectangle() {
    return (
        <div className="rectangle">
            <div
                style={{
                    left: '700px',
                    height: '100vh',
                    width: '50vw',
                    position: 'absolute'
                }}>
                <button
                    style={{
                        marginTop: '160px'
                    }}
                    onClick={() => alert('Button clicked')}>
                    click
                </button>
            </div>
        </div>
    )
}
export default Rectangle
